import React from 'react'
import Image1 from '../images/pogled I2.webp'
import Image2 from '../images/pogled S-Z2.webp'
import Image3 from '../images/pticja J.webp'
import ImageSlider from './ImageSlider';


export default function Properties() {

  const containerStyles = {
    width: '500px',
    height: '280px',
    margin: '0 auto',

  }

  const slides = [
    {url: Image1, title: 'Image1'},
    {url: '../images/pogled S-Z2.webp', title: 'Image2'},
    {url: '../images/pticja J.webp', title: 'Image2'},
  ]
  return (
    <div>
      <div style={containerStyles}>
        <h1>Hello World</h1>
        <ImageSlider slides={slides} />
      </div>
    </div>
  )
}
